import React, { Component } from 'react';
import ComponentsSidebar from '../shared/ComponentsSidebar';
import "react-datepicker/dist/react-datepicker.css";
import { Button } from 'react-bootstrap';

class DossierMedical extends Component {
    constructor(props) {
        super(props);
        this.state = {
            page: '',
            id: '',
            date_naissance: ''
        };
        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }
    handleChange(event) {
        this.setState({ date_naissance: event.target.value });
        this.setState({ id: 152 });
    }
    handleSubmit(event) {
        alert('ity izao ny valuer ato :' + this.state.date_naissance);
        if (this.state.date_naissance.value == null) {
            alert('Ampio valeur fa tsy mety izao');
        }
        else {

            alert('A name was submitted: ' + this.state.date_naissance);
            let url = "DossierMedicalAdulte";
            this.props.history.push(url);
        }
        event.preventDefault();
    }
    render() {
        if (this.state.page.value == null) {
            return (
                <div>
                    <div className="container d-flex p-md-0">
                        <ComponentsSidebar />
                        <div className="az-content-body pd-lg-l-40 d-flex flex-column">
                            <div className="az-content-breadcrumb">
                                <span>Patient</span>
                                <span>Dossier Medicale</span>
                            </div>
                            <h2 className="az-content-title">Dossier Medicale</h2>
                            <h3>Entrer la date de naissance</h3>
                            <form onSubmit={this.handleSubmit}>
                                <div className="wd-200 mg-b-20">
                                    <div className="input-group">
                                        <input type="date" name="daty" id="" value={this.state.date_naissance} onChange={this.handleChange} />
                                    </div>
                                </div>{/* wd-200 */}
                                <div className="row row-xs wd-xl-80p">
                                    <div className="col-sm-6 col-md-3">
                                        <Button type="submit" variant="primary btn-block">OK</Button></div>
                                </div>{/* row */}
                            </form>
                        </div>
                    </div>
                </div>
            );
        }
    }
}

export default DossierMedical;
